import React from 'react'
import { useHistory } from 'react-router';
export default function EditAccount() {

    let history = useHistory();

    function logout(){
        sessionStorage.clear();
        history.push("/");
    }


    return (
        <>
            <h1 className="h1" style={{fontSize:"48px"}}>Edit Your Account</h1>
        </>
    )
}
